import React from 'react'
import { Typography } from '@mui/material'
import Button from '@mui/material/Button'
const Test = () => {
    return (
        <div>
            <Typography  variant="h1" 
            sx={{
                color: "red",
                border: "1px solid black",

            }}
            >
                Hello
            </Typography>
            <Button>
                Test
            </Button>
        </div>
    )
}

export default Test
